import React from "react"

       export  default  class  Userselect  extends React.Component{
                  constructor(props)  {
                          super(props)

                          this.state={
                              default:"selected",
                              value1:"",
                              value2:"",
                              timediff:""
                          }
                          this.show1=this.show1.bind(this)
                          this.show2=this.show2.bind(this)
                          this.select=this.select.bind(this)
                  }


        render(){
              return   <div>
                <select  id="selectmoney">
                  <option value="总收入">总收入</option>
                  <option value="后台">后台</option>
                </select>

                <select name="" id="selectNumber">
                  <option>显示条数</option>
                  <option value="4" >4</option>
                  <option value="5" >5</option>
                  <option value="6" >6</option>
                  <option value="7" >7</option>
                </select>

                  <span className="date" >日期选择</span>
                  <div id="dateshow1">{this.state.value1}</div>
                  <input type="date" id="date1" value="2019-09-19" data-selcet="年-月-日"  onChange={this.show1} />
                  <span id="minus">-</span>
                  <div id="dateshow2"> {this.state.value2}</div>
                  <input type="date" id="date2" value="2019-09-25" data-selcet="年-月-日"  onChange={this.show2}/>
                  <button id="select"  onClick={this.select}>查询</button>
                  <button id="asyc">同步</button>
                  <span className="text"> 交易上次手动同步时间:  <span id="time"> 2019-09-25 10:09:36 </span></span>
                  </div>
        }

        show1(e){
           this.setState({value1:e.target.value})
        }
        show2(e){
            this.setState({value2:e.target.value})
        }
        select(){
           const timeStart = new Date( this.state.value1 ).getTime()
           const  timeEnd  =  new Date(this.state.value2).getTime()
           this.setState({timediff:timeEnd-timeStart})
        }
}
